1	Способен осуществлять поиск, критический анализ и синтез информации, применять системный подход для решения поставленных задач	1
5	Способен осуществлять социальное взаимодействие и реализовывать свою роль в команд	1
6	Способен осуществлять деловую коммуникацию в устной и письменной формах на государственном языке Российской Федерации и иностранном(ых) языке(ах)	1
7	Способен воспринимать межкультурное разнообразие общества в социально-историческом, этическом и философском контекстах	1
8	Способен управлять своим временем, выстраивать и реализовывать траекторию саморазвития на основе принципов образования в течение всей жизни	1
10	Способен создавать и поддерживать в повседневной жизни и в профессиональной деятельности безопасные условия жизнедеятельности для сохранения природной среды, обеспечения устойчивого развития общества, в том числе при угрозе и возникновении чрезвычайных ситуаций и военных конфликтов	1
12	Способен применять естественнонаучные и общеинженерные знания, методы математического анализа и моделирования, теоретического и экспериментального исследования в профессиональной деятельности	2
18	Способен разрабатывать алгоритмы и программы, пригодные для практического применения	2
13	Способен понимать принципы работы современных информационных технологий и программных средств, в том числе отечественного производства, и использовать их при решении задач профессиональной деятельности	2
16	Способен инсталлировать программное и аппаратное обеспечение для информационных и автоматизированных систем	2
19	Способен принимать участие в управлении проектами создания информационных систем на стадиях жизненного цикла	2
